import styled from "styled-components";

const ErrorPageWrapper = styled.div`
  .container-fluid {
    background-color: lightgray;
    height: 100vh;
    display: flex;
    align-items: center;
    justify-content: center;
  }
`;

export default ErrorPageWrapper;
